  <div>
    <h2 className="font-light font-display my-12 text-gray-400 text-sm sm:text-lg">
      GENTES STRUIT
    </h2>
    <h2>NUBES CERNIT</h2>
    <h2>IGNES VINCIT</h2>
  </div>
);

export default Motto;
